import React from 'react';

const Rank = ({name,entries}) => {
	return (
		<div>
			<div className='white f3'>
			{'Gaurav your current rank is'}
			</div>
			<div className='white f1'>
			{'#1'}
			</div>
		</div>
		);
}

export default Rank;
